import logo from './logo.svg';
import './App.css';

function App() {

  function Api()  {
    const apiKey = '72095579eb8b2c9381a1d588e381fcbe';
    const httpRequire =  'https://api.openweathermap.org/data/2.5/weather';
    let citySearch;
    const fetching = `https://api.openweathermap.org/data/2.5/weather?id=6167865&appid=${citySearch}`;
    const current = new Date()
    const temperature = "15";
    const getInput = document.querySelector(".searchBar");
    getInput.addEventListener("keydown", (evnt) =>  {
      if(evnt.key === "Enter") {
        startFetch();
      }
    });
    const startFetch = () =>  {
      citySearch = "pow";
      console.log(citySearch);
    }
  }
  Api()

  return (
    <div className="App">
      <main>
        <div className='searchCity' >
          <input type="text" className="searchBar" placeholder="Search City"/>
        </div>
        <div className="place">
          <h2>Tatuí, Br</h2>
        </div>
        <div className="dates">
          <h2>{current.getUTCDate()}/{current.getUTCMonth()+1}/{current.getUTCFullYear()}</h2>
          <h3>{current.getHours()}:{current.getUTCMinutes() < 10? 0 + current.getUTCMinutes() : current.getUTCMinutes()}:{current.getUTCSeconds()}</h3>
        </div>
        <div className='temperature'>
          <p className="temperatureDisplay">{temperature+"ºC"}</p>
        </div>
      </main>
    </div>
  );
}

export default App;
